int tzlookup(double lat, double lon) {
  if (!(lat >= -90.0 && lat <= +90.0 && lon >= -180.0 && lon <= +180.0))
    return 0;

  int n = -1;
  int x = (180.0 + lon) * 48 / 360.0;
  int y = (90.0 - lat) * 24 / 180.0;
  int u = x|0;
  int v = y|0;
  int i = v * 96 + u * 2;

  i = ((int) TZ_TZDATA[i]) * 56 + ((int) TZ_TZDATA[i + 1]) - 1995;

  while(i + SIZEOF(TZ_TZLIST) < 3136) {
    n = n + i + 1;
    x = (x - u) * 2 % 2;
    y = (y - v) * 2 % 2;
    u = x|0;
    v = y|0;
    i = n * 8 + v * 4 + u * 2 + 2304;
    i = ((int) TZ_TZDATA[i]) * 56 + ((int) TZ_TZDATA[i + 1]) - 1995;
  }

  // Once we hit a leaf, return the relevant timezone.
  return TZ_TZLIST[i + SIZEOF(TZ_TZLIST) - 3136];
}

